import axios from 'axios';

const SortenUrlHelpers = {
    getShortenUrl: function (id) {
        let shortenUrls = [];
        console.log("pappu");

        axios.get('http://localhost:4000/allShortenUrls').then(res => {
            console.log("res: ", res);
            shortenUrls = res.data.shortenUrls || [];
        });

        console.log("shortenUrls", shortenUrls);

        return shortenUrls;
    }
};

export default SortenUrlHelpers;
